import React from 'react';
import './Profile.css';
import InputName from './InputName';
import InputEmail from './InputEmail';
import InputPassword from './InputPassword';

const Profile = ({isProfileOpen, toggleModal}) =>{
    return (
        <div className='profile-modal'>
            <article className="br2 ba dark-gray b--black-10 mv4 w-100 w-50-m w-25-l mw5 shadow-5 center">
                <main className="pa4 black-80">
                    <div className="measure">
                        <fieldset id="sign_up" className="ba b--transparent ph0 mh0">
                        <legend className="f4 fw6 ph0 mh0">Register</legend>
                        <InputName onNameChange={this.onNameChange} />
                        <InputEmail onEmailChange={this.onEmailChange} />
                        <InputPassword onPasswordChange={this.onPasswordChange} />
                        </fieldset>
                        <div className="">
                            {registerButton}
                            {nameBlank === 'blank' || email==='blank' || password==='blank'
                                ?<p>You can not leave input blank</p>
                                :null
                            }
                        </div>
                    </div>
                </main>
            </article>
        </div>
    )
}

export default Profile;
